reated, and will not reflect any future updates to the source calendar. Please see our %4$sUser Guide%5$s for instructions on obtaining your correct dynamic feed URL.'=>'%1$sQuesto URL punta a un file nella Libreria multimediale.%2$s Anche se dovrebbe essere possibile utilizzare questo URL in un %3$s shortcode, si tratterà di un\'istantanea statica del calendario al momento della creazione del file e non rifletterà eventuali aggiornamenti futuri del calendario di origine. Per istruzioni su come ottenere l\'URL corretto del feed dinamico, consultare la %4$sGuida per l\'utente%5$s.','Error: Could not resolve IP address for %1$s.'=>'Errore: Impossibile risolvere l\'indirizzo IP per %1$s.','Resolved IP address for %1$s:'=>'Indirizzo IP risolto per %1$s:','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'Il testo inserito nel campo "Default shortcode" non è un shortcode valido e non è stato salvato.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sImpostazioni aggiornate.%2$s Potrebbe essere necessario aggiornare la pagina per vedere alcune modifiche.','calendar event'=>'evento del calendario','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'Il metodo di richiesta dei feed legacy è deprecato e sarà rimosso con un aggiornamento nel prossimo futuro. Si prega di testare i feed con il metodo di richiesta dei feed legacy disattivato.','Map'=>'Mappa','Recurring event'=>'Evento ricorrente','Recurs every %1$s years'=>'Si ripete ogni %1$s anni','Recurs yearly'=>'Ricorre ogni anno','Recurs every %1$s months'=>'Si ripete ogni %1$s mesi','Recurs monthly'=>'Ricorre mensilmente','Recurs every %1$s weeks'=>'Si ripete ogni %1$s settimane','Recurs weekly'=>'Ricorre settimanalmente','Recurs every %1$s days'=>'Si ripete ogni %1$s giorni','Recurs daily'=>'Ricorre ogni giorno','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'La proprietà "url" dello shortcode %1$s sembra contenere tag HTML; molto probabilmente l\'URL è stato trasformato in un link cliccabile. Di conseguenza, il calendario potrebbe non essere visualizzato correttamente. Si prega di rimuovere il link cliccabile nel codice breve.','The r34ics_url_get_contents() function is no longer supported.'=>'La funzione r34ics_url_get_contents() non è più supportata.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sNota bene:%2$s %3$s la versione 10.6 modifica le opzioni predefinite per diverse impostazioni degli shortcode. Per mantenere la coerenza, queste nuove impostazioni predefinite non sono %4$sabilitate%5$s quando si effettua l\'aggiornamento da una versione precedente. Per saperne di più sulle modifiche, leggere il nostro %6$spost sul blog%7$s, oppure per passare alle nuove impostazioni predefinite, attivare l\'opzione %8$s nella pagina %9$s delle impostazioni%10$s.','Use new parameter defaults (v.10.6)'=>'Utilizzare i nuovi parametri predefiniti (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sNota bene:%2$s %3$s la versione 11.0 ottimizza il modo in cui vengono recuperati gli URL dei feed ICS. Questa modifica utilizza una funzione standard integrata di WordPress, pertanto dovrebbe essere pienamente compatibile con tutte le installazioni esistenti. Se si riscontrano nuovi problemi dopo l\'aggiornamento alla versione 11 o successiva, visitare il %4$sForum di supporto di WordPress%5$s per ricevere assistenza.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sNota bene:%2$s %3$s la versione 11.5.14.2 introduce un nuovo metodo più sicuro per la gestione dei parametri del calendario durante il caricamento tramite AJAX. Si prega di cancellare eventuali plugin di caching in uso, per assicurarsi che i calendari vengano caricati correttamente con il nuovo metodo.','Add %1$s'=>'Aggiungi %1$s','Close'=>'Chiudere','ICS Feed URL:'=>'URL del feed ICS:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Assicurarsi di utilizzare un %1$sURL di sottoscrizione%2$s, non un %3$sURL di visualizzazione web%4$s.%5$s (Inserendo l\'URL direttamente nel browser web si dovrebbe scaricare un %6$s file)','Calendar Title:'=>'Titolo del calendario:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Lasciare vuoto per utilizzare il titolo predefinito del calendario. Inserire %1$s per omettere del tutto il titolo.','Calendar Description:'=>'Descrizione del calendario:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Lasciare vuoto per utilizzare la descrizione predefinita del calendario. Inserire %1$s per omettere del tutto la descrizione.','View:'=>'Vista:','month'=>'mese','list'=>'lista','week'=>'settimana','Count:'=>'Conteggio:','Format:'=>'Formato:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Lasciare %1$s vuoto per includere tutti i prossimi eventi. %2$s deve essere una stringa di formato data standard %3$sPHP%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Mostra le descrizioni degli eventi %1$s (cambiare in un numero nello shortcode inserito per impostare il limite di parole)%2$s','Show event locations %1$s(if available)%2$s'=>'Mostra i luoghi dell\'evento %1$s(se disponibile)%2$s','Show event organizers %1$s(if available)%2$s'=>'Mostra gli organizzatori dell\'evento %1$s(se disponibile)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sNota:%2$s Ulteriori %3$sopzioni di visualizzazione%4$s sono disponibili modificando manualmente lo shortcode dopo l\'inserimento.','Insert %1$s'=>'Inserire %1$s','Do even more with %1$s!'=>'Fate ancora di più con %1$s!','Calendar Builder'=>'Generatore di calendari','Configure all calendar settings with an easy visual interface... no need to manually type shortcodes.'=>'Configurate tutte le impostazioni del calendario con una semplice interfaccia visiva... senza dover digitare manualmente gli shortcode.','Additional Views and Enhanced Features'=>'Viste aggiuntive e funzioni avanzate','New ways to display your calendar including Full, Up Next, Masonry, Month with Sidebar, Widget, and more. Additional capabilities are added to the core Month, Basic, List and Week views.'=>'Nuove modalità di visualizzazione del calendario, tra cui Completo, Successivo, Masonry, Mese con barra laterale, Widget e altro ancora. Sono state aggiunte ulteriori funzionalità alle viste principali Mese, Base, Elenco e Settimana.','Customizer'=>'Personalizzatore','Easily modify your calendar color palettes, fonts, and more, site-wide.'=>'Modificate facilmente le palette di colori del calendario, i caratteri e altro ancora, in tutto il sito.','ICS Events'=>'Eventi ICS','%1$sNew!%2$s Turns %3$s into a full calendar system. Create and manage events directly in WordPress and even integrate them seamlessly with your existing feeds.'=>'%1$sNuovo!%2$s Trasforma %3$s in un sistema di calendario completo. Create e gestite gli eventi direttamente in WordPress e integrateli perfettamente con i vostri feed esistenti.','Visit %1$s to learn more.'=>'Visitate %1$s per saperne di più.','Go PRO!'=>'Vai PRO!','Getting Started'=>'Come iniziare','System Report'=>'Rapporto di sistema','Save Changes'=>'Salva modifiche','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Grazie per aver installato %1$s. Prima di creare il primo shortcode del calendario, visitare la pagina %2$sImpostazioni generali%3$s e verificare che la lingua del sito, il fuso orario e il formato data/ora siano corretti. Per ulteriori informazioni, consultare la %4$sGuida all\'uso%5$s.','Quick Start Guide'=>'Guida rapida','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Sul nostro sito web è disponibile un\'ampia %1$sGuida per l\'utente%2$s. Di seguito sono riportati alcuni collegamenti rapidi alle risorse chiave della documentazione.','General:'=>'Generale:','General WordPress Settings'=>'Impostazioni generali di WordPress','%1$s Settings'=>'%1$s Impostazioni','Working with Shortcodes:'=>'Lavorare con gli shortcode:','Shortcode Overview'=>'Panoramica dei codici brevi','Shortcode Builder'=>'Costruttore di shortcode','Shortcode Parameters Reference'=>'Riferimento ai parametri dello shortcode','Advanced Topics:'=>'Argomenti avanzati:','FAQs and Tips'=>'Domande frequenti e suggerimenti','CSS Guide'=>'Guida CSS','Developer Resources'=>'Risorse per gli sviluppatori','GDPR'=>'GDPR','Appearance'=>'Aspetto','Match calendar color palette to current Block Theme colors'=>'Abbinare la tavolozza dei colori del calendario ai colori attuali del tema del blocco','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Sostituisce la tavolozza di colori neutri predefinita %1$s con le corrispondenze più vicine della tavolozza di colori corrente degli Stili dell\'editor del sito o del file %2$s del tema. Le selezioni dei colori sono algoritmiche e alcune combinazioni potrebbero non superare i test di contrasto dell\'accessibilità. Questa impostazione non ha effetto se si utilizza un tema "classico" che non include un file %3$s.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar settings or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sSi tratta di una funzione attualmente in fase beta.%2$s Potrebbe essere necessario apportare alcune modifiche alle impostazioni del calendario o al CSS per una visualizzazione ottimale, soprattutto se i feed sono codificati per colore. La funzionalità è soggetta a modifiche.','Dark mode'=>'Modalità scura','Inverts color palette (light colors on a dark background). %1$sNote:%2$s Dark mode also automatically applies style changes similar to the %3$s and %4$s shortcode parameters, so you do not need to include them in your shortcode.'=>'Inverte la tavolozza dei colori (colori chiari su sfondo scuro). %1$sNota:%2$s La modalità scura applica automaticamente anche modifiche di stile simili ai parametri %3$s e %4$s del codice breve, quindi non è necessario includerli nel codice breve.','Loading'=>'Caricamento','Always use AJAX to render calendars (recommended)'=>'Usare sempre AJAX per rendere i calendari (consigliato)','When checked, all calendars will render via AJAX (asynchronously after the page loads). This is especially useful in conjunction with other caching plugins, or if your calendars contain a large number of events. Normally, calendar data is sent directly in the HTML of the initial page load unless AJAX has been specified in the shortcode.'=>'Quando è selezionata, tutti i calendari saranno resi tramite AJAX (in modo asincrono dopo il caricamento della pagina). Ciò è particolarmente utile in combinazione con altri plugin di caching o se i calendari contengono un gran numero di eventi. Normalmente, i dati del calendario vengono inviati direttamente nell\'HTML del caricamento iniziale della pagina, a meno che non sia stato specificato AJAX nel codice breve.','Increase memory limit when rendering calendars'=>'Aumenta il limite di memoria durante il rendering dei calendari','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Se il calendario non si carica con un errore fatale di "memoria esaurita", provare ad aumentare il limite di memoria. Si consiglia un minimo di 512 MB. %1$s Note: 1) Alcuni provider di hosting potrebbero non consentire alle applicazioni di superare l\'impostazione predefinita del server. 2) Non è possibile impostare questa opzione al di sotto del limite di memoria predefinito del server.','deprecated'=>'deprecato','If your site has stopped retrieving feeds after the version 11 update, turn on this option to use the legacy request method. This feature is deprecated and will be removed in an update in the near future.'=>'Se il vostro sito ha smesso di recuperare i feed dopo l\'aggiornamento della versione 11, attivate questa opzione per utilizzare il metodo di richiesta precedente. Questa funzione è deprecata e sarà rimossa con un aggiornamento nel prossimo futuro.','Default shortcode'=>'Codice breve predefinito','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Se il sito includerà un gran numero di shortcode di calendario configurati in modo simile, è possibile inserire qui un shortcode "base" predefinito con i parametri che devono essere gli stessi per tutti i calendari. I singoli shortcode del sito possono quindi includere solo i parametri unici per quel calendario, come ad esempio: %1$s Qualsiasi parametro incluso nel singolo shortcode sovrascriverà quello impostato qui.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Consentire l\'accesso a questi nomi host che si risolvono in indirizzi IP riservati','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Se il server del calendario è ospitato sullo stesso server fisico del sito web, fa parte della stessa rete locale o utilizza un indirizzo IP %1$sriservato%2$s, inserire qui il suo nome host per consentire l\'accesso. Per i server di calendario multipli, inserire un nome host per riga. Per ulteriori informazioni, consultare %3$sla documentazione %4$s%5$s.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Inserire un nome host per riga. I nomi di host sono il nome di dominio di base, non un URL completo. %1$sAd esempio, si dovrebbe inserire %2$s, non %3$s.','Caching'=>'Caching','Transient (cache) expiration'=>'Scadenza transitoria (cache)','seconds'=>'secondi','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour).'=>'Imposta per quanto tempo i dati del feed del calendario devono essere memorizzati nella cache del server (transitori di WordPress) prima di essere ricaricati. L\'impostazione predefinita è 3600 (1 ora).','Miscellaneous'=>'Varie','Remove "Add ICS Calendar" button in Classic Editor'=>'Rimuovere il pulsante "Aggiungi calendario ICS" nell\'Editor classico','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Per impostazione predefinita, ICS Calendar aggiunge un pulsante "Aggiungi calendario ICS" alla barra degli strumenti sopra l\'editor WYSIWYG quando si utilizza l\'editor classico. Selezionare questa casella per rimuovere il pulsante. Non ha effetto sui siti che utilizzano l\'editor a blocchi (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s versione 10.6 ha introdotto nuovi valori predefiniti per diversi parametri dei codici brevi. Le nuove installazioni utilizzano automaticamente i nuovi valori predefiniti, ma le installazioni aggiornate continueranno a utilizzare i vecchi valori predefiniti, a meno che non sia selezionata questa casella. Per ulteriori informazioni su queste modifiche, consultare %2$sil nostro blog%3$s.','Our complete user guide is available with full translation into dozens of languages on our website:'=>'La nostra guida completa per l\'utente è disponibile sul nostro sito web con la traduzione completa in decine di lingue:','For assistance, please use our %1$ssupport request form%2$s.'=>'Per assistenza, utilizzare il nostro %1$smodulo di richiesta assistenza%2$s.','When contacting support, please include the %1$sSystem Report%2$s from this page.'=>'Quando si contatta l\'assistenza, includere il %1$sRapporto di sistema%2$s da questa pagina.','Spread the word!'=>'Diffondete la notizia!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Se trovate %1$s utile, potete contribuire a sostenere la nostra crescita e il nostro sviluppo continui con una %2$srecensione a cinque stelle%3$s. Grazie!','%1$s Data Cache'=>'%1$s Cache dati','Clear Cached Calendar Data'=>'Cancellare i dati del calendario memorizzati nella cache','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Questo rilamenterà immediatamente tutti i dati del calendario memorizzati nella cache esistenti (elimina i transitori), costringendo WordPress a ricaricare tutti i calendari la prossima volta che vengono visualizzati. La memorizzazione nella cache riprenderà quindi come prima.','ICS Feed URL Tester'=>'ICS Feed URL Tester','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Se si teme che il plugin non riesca a recuperare correttamente il feed, è possibile testare l\'URL qui.','Enter feed URL...'=>'Immettere l\'URL del feed in...','Test URL'=>'Test URL','Results:'=>'Risultati:','%1$s received.'=>'%1$s ricevuto.